import UserEntery from "./components/UserEntery"

function App() {
  return (
   <BrowserRouter >

   <div></div>



       <Routes>

       <Route path="/" element={<UserEntery />}/>

       </Routes>


   </BrowserRouter>
  ); 
}

export default App;
